import React from "react";
import { NavLink } from "react-router-dom";
import { IoReturnUpBack } from "react-icons/io";

const buttonBack = (path) => {
    return (
        <NavLink
            to={{
                pathname: path,
                state: this.history.location.state,
            }}
        >
            <IoReturnUpBack />
        </NavLink>
    );
};

export default buttonBack;
